import React, { useEffect } from "react";
import "./index.scss";

import Charts from "../../../../../components/charts";

const NegativePositive = ({ data }) => {
    let executorNegative = data.executor[1];
    let planejadorNegative = data.planejador[1];
    let comunicadorNegative = data.comunicador[1];
    let analistaNegative = data.analista[1];
    let executorPositive = data.executor[0];
    let planejadorPositive = data.planejador[0];
    let comunicadorPositive = data.comunicador[0];
    let analistaPositive = data.analista[0];
    // useEffect(() => {
    //     console.log(
    //         executorNegative,
    //         planejadorNegative,
    //         comunicadorNegative,
    //         analistaNegative,
    //         executorPositive,
    //         planejadorPositive,
    //         analistaPositive,
    //         executorPositive
    //     );
    // }, []);
    return (
        <div className="negative-positive-profiler-noAuth">
            <p>
                Essa é a distribuição de fatores <strong>negativos</strong> ou
                <strong> positivos</strong> por perfil.
            </p>
            <div>
                <Charts
                    type="compareProfilers"
                    compareProfilers={{
                        negative: {
                            executor: executorNegative.toFixed(2) + "%",
                            planejador: planejadorNegative.toFixed(2) + "%",
                            comunicador: comunicadorNegative.toFixed(2) + "%",
                            analista: analistaNegative.toFixed(2) + "%"
                        },
                        positive: {
                            executor: executorPositive.toFixed(2) + "%",
                            planejador: planejadorPositive.toFixed(2) + "%",
                            comunicador: comunicadorPositive.toFixed(2) + "%",
                            analista: analistaPositive.toFixed(2) + "%"
                        }
                    }}
                />
            </div>
        </div>
    );
};

export default NegativePositive;
